import React, { Component } from 'react'
import './CardDot.css'
export class CardDot extends Component {
  render() {
    return (
      <div>
        <span class="dot"></span>
        <span class="dot"></span>
        <span class="dot"></span>
        <span class="dot"></span>
      </div>
    )
  }
}

export default CardDot;
